class PosDetail:
    def __init__(self):
        self.td_l: float = 0
        self.td_s: float = 0
        self.yd_l: float = 0
        self.yd_s: float = 0

    def sum(self) -> float:
        return self.td_l - self.td_s + self.yd_l - self.yd_s

    def long_total(self) -> float:
        return self.td_l + self.yd_l

    def short_total(self) -> float:
        return self.td_s + self.yd_s

    def to_dict(self) -> Dict[str, float]:
        r = {}
        for one in ["td_l", "td_s", "yd_l", "yd_s"]:
            r[one] = getattr(self, one)
        return r
